import DataTable from 'react-data-table-component';

export default function TabularTable() {
    //define data array
    const columns = [
        {
            name: 'Name',
            selector: 'name',
        },
        {
            name: 'Gender',
            selector: 'gender',
        },
        {
            name: 'Rating',
            selector: 'rating',
        },
    ];


    const tabledata = [
        { name: "Oli Bob", gender: "male", rating: 1 }
    ];

    return (

        <div className='container mt-5'>
            <DataTable
                columns={columns}
                data={tabledata}
            >
            </DataTable>
        </div>
    );
}
